import React from 'react';
import {
    BrowserRouter as Router,
    Route
} from 'react-router-dom';
import SignIn from '../SignIn'


const routes = [
    {
        path: '/signin',
        components: SignIn
    }
]

const App = () => (
  <Router>
      <div>
          <h1>Home</h1>
          {routes.map((route) => (
            <Route
              key={route.path}
              path={route.path}
              component={route.component}
            />
          ))}
      </div>
  </Router>
);

export default App;
